INSERT INTO `elections` (`id`, `svid_id`, `title`, `held_on_str`, `citizen_reg_str`, `citizen_request_str`, `citizen_return_str`, `military_reg_str`, `military_request_str`, `military_return_str`, `notes`, `order_ticket`) VALUES
(1, 1, 'State Primary Election', 'Tuesday, June 1, 2010', '21 May 2010', '27 May 2010', '31 May 2010', '21 May 2010', '27 May 2010', '31 May 2010', 'The Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
(2, 1, 'State Runoff Primary', 'Tuesday, July 13, 2010', '2 July 2010', '8 July 2010', '12 July 2010', '2 July 2010', '8 July 2010', '12 July 2010', 'The Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 2),
(3, 1, 'General Election', 'Tuesday, November 2, 2010', '22 October 2010', '28 October 2010', '1 November 2010', '22 October 2010', '28 October 2010', '1 November 2010', 'The Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 3),
(4, 2, 'State Primary Election', 'Tuesday, August 24, 2010', '25 July 2010', '14 August 2010', '8 September 2010 ', '25 July 2010', '14 August 2010', '8 September 2010 ', 'Voted, returned ballots must be postmarked by Election Day.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive on time.  In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.\r\n', 1),
(5, 2, 'General Election', 'Tuesday, November 2, 2010', '3 October 2010', '21 October 2010', '17 November 2010', '3 October 2010', '21 October 2010', '17 November 2010', 'The Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive on time.  In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 2),
(6, 3, 'General Election', 'Tuesday, November 2, 2010', '14 October 2010', '19 October 2010', '2 November 2010', '14 October 2010', '19 October 2010', '2 November 2010', 'The Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
(7, 5, 'State Primary Election', 'Tuesday, May 18, 2010', 'Not Required', '11 May 2010', '28 May 2010 ', 'Not Required', '11 May 2010', '28 May 2010 ', 'If you are not registered to vote, the original signed voter registration/ballot request form must be received by the County Clerk 30 days before the election. \r\n\r\nBallots must be postmarked by Election Day and received by 5:00 pm on the deadline date.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
