(11, 7, 'State Primary Election', 'Tuesday, August 10, 2010', '12 July 2010', '3 August 2010', '10 August 2010', '12 July 2010', '3 August 2010', '10 August 2010', 'Colorado also offers a special state write-in ballot for registered voters who, because of military or other contingencies that preclude normal mail delivery, will be unable to vote a mail-in ballot during the normal period.  This blank ballot is available beginning 57 days prior to election day.  Note your request on your registration/ballot request form if you know you will need this ballot in advance, and specify why.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
