(48, 17, 'State Primary Election', 'Tuesday, May 4, 2010', '5 April 2010', '26 April 2010', '4 May 2010', '5 April 2010', '26 April 2010', '4 May 2010', 'A uniformed services voter who is absent from Indiana may, upon returning to Indiana, register at the county voter registration office as late as noon on Election Day, and vote an absentee ballot at that county election board office.  The uniformed services voter (or spouse or dependent of the voter) register and voting under this provisioin must present either the uniformed services voter''s discharge from service or a copy of the uniformed services voter''s government movement orders.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
