(72, 24, 'General Special Election', 'Tuesday, January 19, 2010', 'Waived', '15 January 2010', '19 January 2010', 'Waived', '15 January 2010', '19 January 2010', 'Ballot request must be received by 5:00 pm EST. Overseas Vote Foundation highly recommends that you file your ballot request form by 45 days prior to the election, or earlier. \r\n\r\nVoted ballot must be postmarked by Election Day.\r\n\r\nIf you reside or are stationed outside the United States: ballot must be postmarked by election day, returned to the local election official and arriving not later than January 29 to be counted for Federal elections only.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 2),
