(85, 28, 'State Primary Election', 'Tuesday, August 3, 2010', '7 July 2010', '28 July 2010', '3 August 2010 ', '7 July 2010', '28 July 2010', '3 August 2010', 'Registration is not required if you are voting in Federal elections only.\r\n\r\nBallot Request deadline is the day prior to the election if requested in person.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
(86, 28, 'General Election', 'Tuesday, November 2, 2010', '6 October 2010', '27 October 2010', '2 November 2010', '6 October 2010', '27 October 2010', '2 November 2010', 'Registration is not required if you are voting in Federal elections only.\r\n\r\nBallot Request deadline is the day prior to the election if requested in person.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 2),
