(88, 29, 'State Primary Election', 'Tuesda,y, June 8, 2010', '8 June 2010', '8 June 2010', '8 June 2010', '8 June 2010', '8 June 2010', '8 June 2010', 'If you are not registered to vote, you must request your ballot by the registration deadline.\r\n\r\nMontana has broadened its use of the Federal Write-in Absentee Ballot (FWAB), an optional, downloadable ballot used when your official ballot does not arrive in time. You no longer need to apply for a regular ballot before voting with the FWAB. It may be used just prior to the election as a simultaneous registration form and ballot. Montana voters can use the FWAB to vote for federal offices; and the addendum provided in the ballot to vote for any other offices.  In a primary election, you must identify your party affiliation, and any votes cast for candidates outside that party cannot be counted.  Montana accepts the FWAB for any election.  Note: The FWAB cannot be counted if it is received as an early ballot, (i.e.) before regular absentee ballots have been printed in Montana.  Montana is an "open" primary state meaning that anyone can vote in either party''s primary.', 1),
(89, 29, 'General Election', 'Tuesday, November 2, 2010', '2 November 2010', '2 November 2010', '2 November 2010', '', '', '', 'If you are not registered to vote, you must request your ballot by the registration deadline.\r\n\r\nMontana has broadened its use of the Federal Write-in Absentee Ballot (FWAB), an optional, downloadable ballot used when your official ballot does not arrive in time. You no longer need to apply for a regular ballot before voting with the FWAB. It may be used just prior to the election as a simultaneous registration form and ballot. Montana voters can use the FWAB to vote for federal offices; and the addendum provided in the ballot to vote for any other offices.  Montana accepts the FWAB for any election.  Note: The FWAB cannot be counted if it is received as an early ballot, (i.e.) before regular absentee ballots have been printed in Montana.  ', 2),
