(171, 54, 'State Primary Election', 'Tuesday, September 14, 2010', '25 August 2010', '14 September 2010', '14 September 2010', '25 August 2010', '14 September 2010', '14 September 2010', 'Uniformed Service members who are not deployed away from their primary residence follow the Overseas Citizen deadlines except they have an additional 24 hours to postmark the request for absentee ballot.\r\n\r\nState primary ballot return deadline for a Uniformed Service member,who is absent from their residence due to active duty,  is September 16th, 2008, as long as the ballot is postmarked by, September 9th, 2008.\r\n\r\nGeneral Election ballot return deadline for a Uniformed Service member, who is absent from their residence due to active duty, is November 14th, as long as the ballot is postmarked by Nov 4th, 2008.\r\n\r\nThe Federal Write-In Absentee Ballot (FWAB) is an optional, downloadable ballot for use in cases where the ballot sent from your election office does not arrive in time. In order to maintain your option to use the FWAB your registration/request for a ballot must arrive at your election office by the deadline above.', 1),
